import React, { useState, useEffect } from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import { Button } from '@mui/material';


const rows = [
    { id: 1, date: "01/12/23", description: "alguma coisa aqui", total: 234.00, items: [{ nome: "test", qtd: 2, value: 12, total: 24 }] }
];

export default function TableComponent({ data }) {
    const [open, setOpen] = React.useState(false);

    const handleClickOpen = () => {
      setOpen(true);
    };

    const handleClose = () => {
      setOpen(false);
    };

    return (
        <TableContainer component={Paper}>
            <Table sx={{ minWidth: "90vw" }} >
                <TableHead>
                    <TableRow>
                        <TableCell align="right">Data</TableCell>
                        <TableCell align="right">Descricao</TableCell>
                        <TableCell align="right">total</TableCell>
                        <TableCell align="right">item</TableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {rows.map((row) => (
                        <TableRow
                            key={row.id}
                        >
                            <TableCell align="right" >
                                {row.date}
                            </TableCell>
                            <TableCell align="right" >
                                {row.description}
                            </TableCell>
                            <TableCell align="right">{row.total}</TableCell>
                            <TableCell align="right"><Button variant="outlined">view</Button></TableCell>
                        </TableRow>
                    ))}
                </TableBody>
            </Table>
        </TableContainer>
    );
}
